import React, { Component } from 'react'
import Company from './Company'
import { Link } from 'react-router-dom'

export default class Menu extends Component {
  render() {
    return (
      <div>
        <Link to={'/company'}><button>Creer mon entreprise</button></Link>
      </div>
    )
  }
}
